    private double[] data;
    private int len_of_filter;
    public double[] output;

    /**
     * Constructor
     * @param data
     */
    public Bandpass(double[] data){
        this.data = data;
        this.len_of_filter = this.impulse.length;
        this.output = new double[data.length-impulse.length + 1];
        normalize();
        convolve();
    }

    /**
     * Returns the mean of the data.
     * @param data Data to process.
     * @return The mean of the data.
     */
    private double getMean(double[] data) {
        double sum = 0.0;
        for (double a : data)
            sum += a;
        return sum / data.length;
    }

    /**
     * Returns the variance in the given data.
     * @param data Data to process.
     * @return The variance in the given data.
     */
    private double getVariance(double[] data) {
        double mean = getMean(data);
        double temp = 0;
        for (double a : data)
            temp += (mean - a) * (mean - a);
        return temp / data.length;
    }

    /**
     * Returns the standard deviation in the given data.
     * @param data Data to process.
     * @return The standard deviation in the given data.
     */
    private double getStdDev(double[] data) {
        return Math.sqrt(getVariance(data));
    }


    /**
     * Returns whether the standard deviation of the output is at least 5.
     * @return Whether the standard deviation of the output is at least 5.
     */
    public boolean getResult(){
        double value = getStdDev(output);
        return value >= 5;
    }

    /**
     * Applies the bandpass filter to the signal.
     */
    private void convolve(){
        for(int i = len_of_filter - 1; i < data.length; i++){
            output[i - len_of_filter + 1] = 0;
            for (int j = 0; j < impulse.length; j++){
                output[i - len_of_filter + 1] = output[i - len_of_filter + 1] + impulse[j] * data[i-j];
            }
        }
    }

    /**
     * Normalizes the data set.
     */
    private void normalize(){
        double mean = getmean(data);
        for(int i = 0; i < data.length; i++){
            data[i] = data[i] - mean;
        }
    }

    /**
     * Returns the mean of the data.
     * @param s Data
     * @return The mean of the data.
     */
    private double getmean(double[] s){
        double sum = 0;
        for (int i = 0; i < s.length; i++){
            sum = sum + s[i];
        }
        double mean = sum/s.length;
        return mean;
    }

